(8, '1', '2', '2013-03-20 10:19:47', 'Palestinians see Israeli ''growth'' as roadblock', 'STORY HIGHLIGHTS\r\nSome argue growth of Israeli settlements make it more difficult to draw a contiguous Palestinian state\r\nIsraeli mayor: "This place doesn''t disconnect the Palestinian state. ... It is not a buffer at all"\r\nPalestinian: "They take our land. They take our land"\r\nObama''s view: No more settlement building unless it''s agreed to in Israeli-Palestinian negotiations\r\nMA''ALE ADUMIM, West Bank (CNN) -- The map on the wall of Mayor Benny Kashriel''s office shows the growth of this West Bank settlement -- shopping mall and all -- to a bustling community of 40,000.\r\nAnd in the upper left hand corner, a lonely police station and lines drawn to highlight the so-called E-1 parcel the mayor hopes is soon busy with construction -- even though the visiting President Barack Obama would be furious if the Israeli government gave the green light.\r\n"I expect my prime minister to take care of our young couples who have been born in Ma''ale Adumim, that have been raised and educated in Ma''ale Adumim and now these young couples want to live by their families. ...It is not human to not let them live in the place that they have been born."', '0', 'YES'),
(9, '2', '1', '2013-03-21 16:00:00', 'Obama ', 'STORY HIGHLIGHTS\r\nSome argue growth of Israeli settlements make it more difficult to draw a contiguous Palestinian state\r\nIsraeli mayor: "This place doesn''t disconnect the Palestinian state. ... It is not a buffer at all"\r\nPalestinian: "They take our land. They take our land"\r\nObama''s view: No more settlement building unless it''s agreed to in Israeli-Palestinian negotiations\r\nMA''ALE ADUMIM, West Bank (CNN) -- The map on the wall of Mayor Benny Kashriel''s office shows the growth of this West Bank settlement -- shopping mall and all -- to a bustling community of 40,000.\r\nAnd in the upper left hand corner, a lonely police station and lines drawn to highlight the so-called E-1 parcel the mayor hopes is soon busy with construction -- even though the visiting President Barack Obama would be furious if the Israeli government gave the green light.\r\n"I expect my prime minister to take care of our young couples who have been born in Ma''ale Adumim, that have been raised and educated in Ma''ale Adumim and now these young couples want to live by their families. ...It is not human to not let them live in the place that they have been born."', '1', 'YES'),
