INSERT INTO `question-type` (`ID`, `title`, `disc`) VALUES
(1, 'Fill in the blanks', 'By selecting this type you will be able to enter the question with the required blank as ‘-----‘, also you can provide the required tips for the students and answer key for the validation purpose. '),
(2, 'Multiple choices: single option', 'After entering the question and tips, you can select the number of choices for the questions, which will help you to create options and set answer key accordingly. '),
(3, 'Multiple choices: multiple correct options', 'Like the above type ,by selecting the number of options ,you will get the provision for creating options and set multiple answer keys by ticking on choices'),
(4, 'True / false', 'After entering the question and tips, you can set the answer key as true or false'),
(5, 'Descriptive Questions', 'Here you can enter the questions, tips and answer key for the validation purpose'),
(6, 'Case study', 'Fill in the blanks. Here you can enter the passage for the case study with required blanks and the tips accordingly. Also you have the provision for selecting the number of blanks entered in the above passage. Which will brings you the option for setting the respective answer keys for each blanks.(make sure that answer keys are provided in the same order of the blanks in the passage ).'),
(7, 'Case study: True / False', 'Here you will be able to create ‘true or false’ sub-questions and set answer keys for each sub-questions based on the passage entered above as case study,.'),
(8, 'Case study: Multiple choices', 'Here you will be able to create ‘multiple choice’ sub-questions and set answer keys for each sub-questions based on the passage entered above as case study'),
(9, 'Audio : Fill in the blanks ', 'Instead of entering question, here you will get an option for uploading an audio file. Also can create ‘fill in the blanks’ sub-questions and set answer keys for each sub-questions based on the uploaded audio file.'),
(10, 'Audio : True / False', 'Here you will be able to create ‘true or false’ sub-questions and set answer keys for each sub-questions based on the audio file uploading with this question'),
(11, 'Audio : Multiple choices', 'Here you will be able to create ‘Multiple choice’ sub-questions and set answer keys for each sub-questions based on the audio file uploading with this question.'),
(12, 'Video : Fill in the blanks', 'Instead of entering question, here you will get an option for upload a video file. Also can create ‘fill in the blanks’ sub-questions and set answer keys for each sub-questions based on the uploaded audio file'),
(13, 'Video : True / False', 'Here you will be able to create ‘true or false’ sub-questions and set answer keys for each sub-questions based on the video file uploading with this question'),
(14, 'Video : Multiple choices', 'Here you will be able to create ‘Multiple choice’ sub-questions and set answer keys for each sub-questions based on the video file uploading with this question');
